import { Layout } from '../components';
import { gql } from '@apollo/client';

export const fetchAllUsers = gql`
  query fetchAllUsers {
    usersList {
      id
      name
      joinDate {
        year
        month
        day
        hour
        minute
        second
      }
      avatar
      pastPosts {
        id
      }
    }
  }


`;

export const fetchAllPosts = gql `
  query fetchAllPosts {
    postsList {
      id
      author {
        id
        name
      }
      title
      date {
        year
        month
        day
        hour
        minute
        second
      }
    }
  }
`



